import React from "react";
import ReactDOM from "react-dom/client";
import { RouterProvider, createBrowserRouter } from "react-router-dom";

import "./css/main.css";
import Layout from "./components/Layout";
import ErrorPage from "./pages/ErrorPage";
import Main from "./pages/Main";
import Home from "./pages/Home";
import UserProfile from "./pages/UserProfile";
import EditProfile from "./pages/EditProfile";
import Collections from "./pages/Collections";
import ItemList from "./pages/ItemList";
import Item from "./pages/Item";
import EditCollection from "./pages/EditCollection";
import CollectionItems from "./pages/CollectionItems";
import CreateItem from "./pages/CreateItem";
import EditItem from "./pages/EditItem";
import Logout from "./pages/Logout";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout />,
    errorElement: <ErrorPage />,
    children: [
      { index: true, element: <Main /> },
      { path: "home", element: <Home /> },
      { path: "profile/:id", element: <UserProfile /> },
      { path: "profile/:id/edit", element: <EditProfile /> },
      // { path: "collections/:id", element: <Collections /> },
      { path: "profile/:id/editcollection", element: <EditCollection /> },
      { path: "profile/:name", element: <CollectionItems /> },
      { path: "profile/:id/:name/items", element: <ItemList /> },
      { path: "profile/:id/:name/items/item", element: <Item /> },
      { path: "profile/:id/:name/items/edit", element: <EditItem /> },
      { path: "create", element: <CreateItem /> },
      { path: "logout", element: <Logout /> },
    ],
  },
]);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);
